    false,nt"url": null,nt"notes": "Three marine mammals were regularly observed
    at Amchitka Island: sea otters (Enhydra lutris), Steller's sea lions (Eumetopias
    jubata), and harbor seals (Phoca vitulina). These mammals were observed in the bays
    and harbor, on beaches, on inter-coastal reefs, and on offshore islets. In addition,
    a beached whale was discovered on 31 May 1980 at Crown Reefer Point. This paper
    incorporates the data gathered in 1980 and is broken down by species.",nt"license_title":
